INSERT INTO `recommendations` (`id`, `advice`, `sanction`, `communique`, `alert_id`) VALUES
(1, 'Se debe evitar las aglomeraciones de mas de 100 personas. Todos los eventos pÃºblicos como conciertos y actividades grupales deben ser suspendidas.', 'Multas econÃ³micas a las instituciones educativas como cierre temporal de las mismas', 'Las instituciones educativas de nivel inferior y superior, tanto a nivel pÃºblico y privado deben suspender las labores educativas de forma presencial. Sus estudiantes continuaran el proceso educativo de manera virtual hasta nuevo aviso. ', 1),
(2, 'Al toser o estornudar, cubrase la boca y la nariz con el codo flexionado o con un paÃ±uelo; tire el paÃ±uelo inmediatamente y lÃ¡vese las manos con un desinfectante de manos a base de alcohol, o con agua y jabÃ³n.', 'Cierre de instalaciones permanente.', 'Dado el decreto N-145 generado por la sala de lo constitucional se decreta que todo aquel evento deportivo queda suspendido hasta nuevo aviso.', 1),
(3, 'Mantenga al menos 1 metro (3 pies) de distancia entre usted y las demÃ¡s personas, particularmente aquellas que tosan, estornuden y tengan fiebre. El uso de mascarilla es obligatorio para todos los ciudadanos.', 'Se detendrÃ¡ a todos aquellos que incumplan las normas de distanciamiento social dejando en su expendiente dicho incumplimiento.', 'Aquellas dependencias del gobierno asi como empresa privada deberan suspender labores a aquellos trabajadores mayores de 60 aÃ±os.', 2),
(4, 'Si tiene fiebre, tos y dificultad para respirar, solicite atenciÃ³n mÃ©dica. Indique a su prestador de atenciÃ³n de salud si ha viajado a una zona de China en la que se haya notificado la presencia del covid-19, o si ha tenido un contacto cercano con alguien que haya viajado desde China o Europa.', 'Aquellas personas que circulen sin permiso de su trabajo o no pertenezcan al sector salud, Fuerza Armada o Ministerio de Hacienda deben ser detenidas y llevadas a centros de contenciÃ³n..', 'Los vuelos e ingresos tanto maritimos y terrestres quedan cerrados  hasta nuevo aviso. Con el fin de salvaguardar la integridad la salud del pueblo SalvadoreÃ±o se decreta cuarentena total a nivel nacional.', 2),
(5, 'Permanezca en casa si empieza a encontrarse mal, aunque se trate de sÃ­ntomas leves como cefalea y rinorrea leve, hasta que se recupere. El abastecimiento de alimentos distanciado periodicamente es recomendable.', 'Aquellos ciudadanos que inclumplan las medidas establecidas por el gobierno con el fin de salvaguardar la vida serÃ¡n llevados a un centro de contenciÃ³n y al finalizar su confinamiento serÃ¡n procesados por la ley.', 'El Gobierno de El Salvador establece el confinamiento social. Solo aquellos ciudadanos que trabajen en el sector salud deben salir de casa. Se establece el cierre de maquilas y fÃ¡bricas hasta nuevo aviso.', 3),
